import React from 'react'
import ExemploFilter from './ExemploFilter.js'
import ExemploMap from './ExemploMap.js'
import Exercicio1 from './Exercicio1.js'
import Exercicio2 from './Exercicio2.js'

 const HomeExercicios = () => {

  const posts = [
    { id: 1, title: 'Post 1', content: 'Conteúdo do post 1' },
    { id: 2, title: 'Post 2', content: 'Conteúdo do post 2' },
    { id: 3, title: 'Post 3', content: 'Conteúdo do post 3' }
    ];

  return (
    <>
      <ExemploFilter/>
      <hr/>
      <ExemploMap/>
      <hr/>
      <Exercicio1/>
      <hr/>
      <Exercicio2 posts={posts}  />
      <hr/>
    </>
  )
}

export default HomeExercicios


